import { useParams } from 'react-router-dom';
import { useState } from 'react';
const PumpDetail = () => {
  const { id } = useParams(); // Ensure you're extracting the 'id' parameter from the URL
  console.log('Pump ID:', id);  // Debug log to check if the 'id' is correctly extracted

  const [pump, setPump] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPumpDetails = async () => {
      try {
        if (!id) {
          throw new Error('ID is not available');
        }
        console.log('Fetching pump details for ID:', id);
        const response = await fetch(`http://localhost:5001/api/pumps/${id}`);

        if (!response.ok) {
          throw new Error('Pump not found or an error occurred');
        }

        const data = await response.json();

        if (data.success && data.pump) {
          setPump(data.pump);
        } else {
          setError('Pump not found or an error occurred.');
        }
      } catch (error) {
        setError(error.message); // Display the specific error message
      } finally {
        setLoading(false); // Set loading to false once the request is complete
      }
    };

    fetchPumpDetails();
  }, [id]);

  // Handle loading, error, and displaying pump details
  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>{error}</p>;
  }

  if (!pump) {
    return <p>Pump details not available.</p>;
  }

  return (
    <div className="pump-detail">
      <h1>{pump.name}</h1>
      <img
        src={`http://localhost:5001/uploads/${pump.image}`}
        alt={pump.name}
        style={{ width: '100%', height: 'auto' }}
      />
      <p><strong>Price:</strong> {pump.price}</p>

      <h3>Features:</h3>
      <ul>
        {pump.features && pump.features.length > 0 ? (
          pump.features.map((feature, idx) => (
            <li key={idx}>{feature}</li>
          ))
        ) : (
          <p>No features available for this pump.</p>
        )}
      </ul>

      {/* Optional: Add a back button */}
      <button onClick={() => window.history.back()} style={{ marginTop: '20px' }}>
        Back to Pump List
      </button>
    </div>
  );
};

export default PumpDetail;
